sys_variable_value.value:
(function execute(inputs, outputs) {
 try
{
	var r = new sn_ws.RESTMessageV2('x_821178_vodafone.Azure Function Call', 'Add Contact');
	r.setRequestHeader("Content-Type", "application/json;charset=UTF-8");
    var body = JSON.stringify({"givenName": inputs.firstName, "surname": inputs.lastName, "emailAddresses": [{"address": inputs.emailToAdd, "name": inputs.firstName + inputs.lastName}], "businessPhones": [inputs.contact]});

    r.setRequestBody(body);
    r.setHttpMethod("post");
    var response = r.execute();
    var responseBody = response.getBody();
    var responseObj = JSON.parse(responseBody);

	if(responseObj.statusCode == 201)
	{
		gs.info("Action Result: " + inputs.firstName);
        outputs.status = "Created.";
	}
	else
	{
		gs.info("Not successful: " + responseObj.statusCode + ":" + responseObj.message);
        outputs.status = "Error";
	}
}
 catch(err) 
 {
	gs.info("Error: " + err);
    outputs.status = "Error" + err;
 }
})(inputs, outputs);

