sys_variable_value.value:
(function execute(inputs, outputs) {
 try
{
	var r = new sn_ws.RESTMessageV2('x_821178_vodafone.Azure Function call', 'Default GET');
	r.setRequestHeader("Content-Type", "application/json;charset=UTF-8");
    var body = JSON.stringify({"GivenName": inputs.firstName, "Surname": inputs.lastName, "EmailAddress": inputs.email, "ContactNumber": inputs.contactNumber, "TargetEmail": inputs.targetEmail, "Status": ""});
	r.setRequestBody(body);
    r.setRequestHeader("Authorization", "isaZ3ygECZuLJgnYyfl2Chly8B_Q9DcAg0FCqWLd2UxHbtuLVwuFXCyljE413DNS2EEO9kxfTgvHLR3X9RHcTg")
    r.setQueryParameter("name", inputs.firstName);

	var response = r.execute();
	var responseBody = response.getBody();
	var httpStatus = response.getStatusCode();

	if(httpStatus == 200)
	{
		var responseObj = responseBody;
		gs.info("Action Result: " + inputs.firstName);
        outputs.status = "Sender Triggered";
	}
	else
	{
		gs.info("HTTP status code:" + httpStatus + ":" + responseBody);
        outputs.status = "Error";
	}
}
 catch(err) 
 {
	gs.info("Error: " + err);
    outputs.status = "Error" + err;
 }
})(inputs, outputs);

